import React from "react";

function AllpostPage({ posts }) {
  return (
    <div>
      {posts.map((x, i) => (
        <div>
          <img url="https://www.diocesecpa.org/blog/wp-content/uploads/2019/07/Focus.jpg"></img>
        </div>
      ))}
    </div>
  );
}

export default AllpostPage;
